import './App.css';
import Wheellight from './component/Wheel-light';
import WheelList from './component/Wheel-list';

function App() {
  return (
    <div className="wheel">
      <Wheellight/>
      <WheelList/>
      <img src="images/prize_img1.png " />
    </div>
  );
}

export default App;
